{
  "openapi": "3.1.0",
  "info": {
    "title": "VEED Text to Video API",
    "description": "The VEED Text to Video API API is used to create VEED projects using AI-generated scripts, titles, text-to-speech, background music and stock footage.",
    "version": "v1.0.0"
  },
  "servers": [
    {
      "url": "https://www.veed.io/text-to-video-ap/api"
    }
  ],
  "paths": {
    "/generate/async": {
      "post": {
        "description": "Using a prompt OR script AND voice OR avatar, generate a VEED video project",
        "operationId": "GenerateProject",
        "x-openai-isConsequential": false,
        "requestBody": {
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "prompt": {
                    "description": "Prompt that is used to generate a video script if `script` is not provided",
                    "type": "string"
                  },
                  "script": {
                    "description": "The video script of the generated video if `prompt` is not provided",
                    "type": "string"
                  },
                  "voice": {
                    "description": "Type of voice used for the voiceover if `avatar` is not provided",
                    "type": "string",
                    "enum": ["male", "female"]
                  },
                  "avatar": {
                    "description": "The avatar used in the generated video if `voice` is not provided",
                    "type": "string",
                    "enum": ["avery", "isabella", "lily", "devon", "noah", "mateo"]
                  }
                },
                "additionalProperties": false
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "Expected response to a valid request",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/Project"
                }
              }
            }
          }
        }
      }
    }
  },
  "components": {
    "schemas": {
      "Project": {
        "description": "A VEED project",
        "properties": {
          "prompt": {
            "type": "string"
          },
          "project": {
            "type": "object",
            "required": ["id", "name", "link", "thumbnail"],
            "properties": {
              "id": {
                "type": "string",
                "format": "uuid"
              },
              "title": {
                "description": "The title of the video",
                "type": "string"
              },
              "link": {
                "description": "URL to edit the project in the VEED editor",
                "type": "string",
                "format": "uri"
              },
              "thumbnail": {
                "description": "Thumbnail image for the video",
                "type": "string",
                "format": "uri"
              }
            }
          }
        },
        "type": "object",
        "required": ["prompt", "project"]
      }
    }
  }
}

{
  "openapi": "3.0.0",
  "info": {
    "title": "Netlify",
    "description": "Deploy static websites",
    "version": "1.0"
  },
  "servers": [
    {
      "url": "https://app.netlify.com"
    }
  ],
  "paths": {
    "/partner-drop/api/v1/drop": {
      "post": {
        "operationId": "deployToNetlify",
        "x-openai-isConsequential": false,
        "summary": "Deploy files to Netlify to create website. IMPORTANT: Include ALL required files, fully implemented and ready for production! Old files must be re-uploaded.",
        "requestBody": {
          "required": true,
          "content": {
            "application/json": {
              "schema": {
                "type": "object",
                "properties": {
                  "files": {
                    "description": "file paths &amp; file content to deploy",
                    "type": "array",
                    "items": {
                      "type": "object",
                      "properties": {
                        "path": {
                          "description": "file path",
                          "type": "string"
                        },
                        "content": {
                          "description": "file content",
                          "type": "string"
                        }
                      }
                    }
                  }
                }
              }
            }
          }
        },
        "responses": {
          "200": {
            "description": "OK",
            "content": {
              "application/json": {
                "schema": {
                  "$ref": "#/components/schemas/Deploy"
                }
              }
            }
          }
        }
      }
    }
  },
  "components": {
    "schemas": {
      "Deploy": {
        "type": "object",
        "properties": {
          "url": {
            "type": "string",
            "description": "site URL"
          },
          "claim_url": {
            "type": "string",
            "description": "Save your site via the Claim URL! Or it will be deleted in one hour!!! The URL must contain the token inside the hash for it to work. After claiming, users can use netlify dashboard to download files, setup a custom domain, and configure settings."
          },
          "important_message": {
            "type": "string",
            "description": "status"
          }
        }
      }
    }
  }
}

